import React from 'react';
import { Routes, Route } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import Layout from './components/layout/Layout';
import ProtectedRoute from './components/auth/ProtectedRoute';
import VideoConsultation from './components/telemedicine/VideoConsultation';
import Login from './components/auth/Login';
import Dashboard from './components/dashboard/Dashboard';
import Unauthorized from './components/auth/Unauthorized';
import SymptomChecker from './components/ai/SymptomChecker';
import PrescriptionSuggestions from './components/ai/PrescriptionSuggestions';
import AppointmentOptimizer from './components/ai/AppointmentOptimizer';
import WaitingRoom from './components/telemedicine/WaitingRoom';
import PrescriptionForm from './components/prescriptions/PrescriptionForm';
import PharmacyDashboard from './components/pharmacy/PharmacyDashboard';
import MedicationReminders from './components/reminders/MedicationReminders';
import PatientHistory from './components/patient/PatientHistory';
import LabTestOrder from './components/lab/LabTestOrder';
import LabTestResults from './components/lab/LabTestResults';
import InsuranceClaimForm from './components/insurance/InsuranceClaimForm';
import InsuranceClaimList from './components/insurance/InsuranceClaimList';
import ClinicForm from './components/clinic/ClinicForm';
import BranchForm from './components/clinic/BranchForm';
import TwoFactorSetup from './components/auth/TwoFactorSetup';

// Create theme
const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Layout>
        <Routes>
          {/* Public routes */}
          <Route path="/login" element={<Login />} />
          <Route path="/unauthorized" element={<Unauthorized />} />

          {/* Protected routes */}
          <Route
            path="/"
            element={
              <ProtectedRoute allowedRoles={['admin', 'doctor', 'nurse', 'receptionist']}>
                <Dashboard />
              </ProtectedRoute>
            }
          />

          {/* Telemedicine routes */}
          <Route
            path="/video/:id"
            element={
              <ProtectedRoute allowedRoles={['admin', 'doctor', 'patient']}>
                <VideoConsultation />
              </ProtectedRoute>
            }
          />

          {/* Symptom Checker route */}
          <Route
            path="/symptom-checker"
            element={
              <ProtectedRoute allowedRoles={['admin', 'doctor', 'patient']}>
                <SymptomChecker />
              </ProtectedRoute>
            }
          />

          {/* Prescription Suggestions route */}
          <Route
            path="/prescription-suggestions"
            element={
              <ProtectedRoute allowedRoles={['admin', 'doctor']}>
                <PrescriptionSuggestions />
              </ProtectedRoute>
            }
          />

          {/* Appointment Optimizer route */}
          <Route
            path="/appointment-optimizer"
            element={
              <ProtectedRoute allowedRoles={['admin', 'doctor', 'receptionist']}>
                <AppointmentOptimizer />
              </ProtectedRoute>
            }
          />

          {/* Waiting Room route */}
          <Route
            path="/waiting-room/:id"
            element={
              <ProtectedRoute allowedRoles={['admin', 'doctor', 'patient']}>
                <WaitingRoom />
              </ProtectedRoute>
            }
          />

          {/* Prescription Form route */}
          <Route
            path="/create-prescription"
            element={
              <ProtectedRoute allowedRoles={['admin', 'doctor']}>
                <PrescriptionForm />
              </ProtectedRoute>
            }
          />

          {/* Pharmacy Dashboard route */}
          <Route
            path="/pharmacy-dashboard"
            element={
              <ProtectedRoute allowedRoles={['pharmacy']}>
                <PharmacyDashboard />
              </ProtectedRoute>
            }
          />

          {/* Medication Reminders route */}
          <Route
            path="/medication-reminders"
            element={
              <ProtectedRoute allowedRoles={['admin', 'doctor', 'patient']}>
                <MedicationReminders />
              </ProtectedRoute>
            }
          />

          {/* Patient History route */}
          <Route
            path="/patient-history"
            element={
              <ProtectedRoute allowedRoles={['admin', 'doctor', 'patient']}>
                <PatientHistory />
              </ProtectedRoute>
            }
          />

          {/* Lab Test Management routes */}
          <Route
            path="/lab-test/order"
            element={
              <ProtectedRoute allowedRoles={['admin', 'doctor']}>
                <LabTestOrder />
              </ProtectedRoute>
            }
          />
          <Route
            path="/lab-test/results"
            element={
              <ProtectedRoute allowedRoles={['admin', 'doctor']}>
                <LabTestResults />
              </ProtectedRoute>
            }
          />

          {/* Insurance Claim Management routes */}
          <Route
            path="/insurance/claim"
            element={
              <ProtectedRoute allowedRoles={['admin', 'doctor']}>
                <InsuranceClaimForm />
              </ProtectedRoute>
            }
          />
          <Route
            path="/insurance/claims"
            element={
              <ProtectedRoute allowedRoles={['admin', 'doctor']}>
                <InsuranceClaimList />
              </ProtectedRoute>
            }
          />

          {/* Clinic and Branch Management routes */}
          <Route
            path="/clinic/add"
            element={
              <ProtectedRoute allowedRoles={['admin']}>
                <ClinicForm />
              </ProtectedRoute>
            }
          />
          <Route
            path="/clinic/:clinicId/branch/add"
            element={
              <ProtectedRoute allowedRoles={['admin']}>
                <BranchForm />
              </ProtectedRoute>
            }
          />

          {/* 2FA Setup route */}
          <Route
            path="/2fa-setup"
            element={
              <ProtectedRoute allowedRoles={['admin', 'doctor', 'nurse', 'receptionist', 'patient']}>
                <TwoFactorSetup />
              </ProtectedRoute>
            }
          />
        </Routes>
      </Layout>
    </ThemeProvider>
  );
}

export default App;
